#
# TABLE STRUCTURE FOR: orders
#

DROP TABLE IF EXISTS `orders`;

CREATE TABLE `orders` (
  `order_id` int(11) NOT NULL AUTO_INCREMENT,
  `customer_id` int(11) NOT NULL,
  `item_id` int(11) NOT NULL,
  `export_id` int(11) NOT NULL,
  `import_id` int(11) DEFAULT NULL,
  `quantity` int(11) NOT NULL,
  `price` decimal(15,2) NOT NULL,
  PRIMARY KEY (`order_id`),
  KEY `customers` (`customer_id`),
  KEY `items` (`item_id`),
  KEY `exports` (`export_id`),
  KEY `imports` (`import_id`),
  CONSTRAINT `customers` FOREIGN KEY (`customer_id`) REFERENCES `customers` (`customer_id`) ON DELETE CASCADE,
  CONSTRAINT `exports` FOREIGN KEY (`export_id`) REFERENCES `exports` (`export_id`) ON DELETE CASCADE,
  CONSTRAINT `imports` FOREIGN KEY (`import_id`) REFERENCES `imports` (`import_id`) ON DELETE CASCADE,
  CONSTRAINT `items` FOREIGN KEY (`item_id`) REFERENCES `items` (`item_id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


UPDATE orders
SET import_id = NULL
WHERE order_id > 300;
